import React from 'react';
const Basket = props => {
    return (
        <div className="basket">
            <h1>saddsasaddsa</h1>
            <h1>saddsasaddsa</h1>
            <h1>saddsasaddsa</h1>
            <h1>saddsasaddsa</h1>
            <h1>Twój koszyk</h1>
            <table>
                <thead>
                    <tr>
                        <th>Produkt</th>
                        <th>Cena</th>
                        <th>Ilość</th>
                        <th>Razem</th>
                    </tr>
                </thead>
            </table>
            
        </div>
    );
};
export default Basket;
